import React from "react";
import "./Footer.module.css";
import logo from "../NavBar/assets/SchorTax.png";

const Footer = () => {
  return (
    <div className="footer" id="footer">
      <img src={logo} alt="Schor Tax & Consulting" className="footerLogo" />

      <div className="footerText">
        SchorTax@gmail.com
      </div>
    </div>
  );
};

export default Footer;
